paths:
  /ptetakake/{id}/cmarikilu:
    get:
      operationId: getCcakutavi
      description: Anonymized
      tags:
        - tag
      parameters:
        - name: id
          required: true
          description: Anonymized
          in: path
          schema:
            type: string
      responses:
        '200':
          description: Handling 200 responses for getCcakutavi
