            - jupamani
            - zadegufa
        debicapu:
          default: false
          type: boolean
        dekocelo:
          default: false
          type: boolean
        luvejadi:
          default: false
          deprecated: true
          type: boolean
    S_tagavuge:
      type: object
      required:
